import React from 'react';
import './Headerstyle.css';
import linkedin from '/home/lois/Documentos/filmlist/Project-film-list/film-list/src/iconmonstr-linkedin-5.svg';
import github from '/home/lois/Documentos/filmlist/Project-film-list/film-list/src/iconmonstr-github-5.svg';

export default function Footer(){

    return(
        <>
        <footer>
            <p>Made by @luishnrqq</p>
            <a href='https://www.linkedin.com/in/luishnrqaraujo/'> Linkedin <img className='logo-img' src={linkedin} alt='linkedin-logo' /> </a>
            <a href='https://github.com/luishnrqq'> Github <img  className='logo-img' src={github}  alt='github-logo'/> </a>
        </footer>
        </>
    )
}
